import './index.css'; 
import Logobar from './features/Logobar';
import Navbar from './features/Navbar';
import Body from './features/Body';
import { useEffect } from 'react';



function App() {


   //Render once to set userId
   useEffect(() => {
    localStorage.setItem("userId", "123");
  }, []); 




  return (
    <>
    <div> <Logobar /> </div>
    <div> <Navbar /> </div>
    <div> <Body /> </div>
    </>
  )
}

export default App;
